var Pixel = function(x, y, c) 
{
    if(isFinite(x) && isFinite(y))
	{
        var color = 
		{
            r: Pixel.color.r,
            g: Pixel.color.g,
            b: Pixel.color.b,
            a: Pixel.color.a*c
        };

        setPixel(x,y, color);
    }
};

function setPixel (x,y,c) 
{
    var p=ctx.createImageData(1,1);
    p.data[0]=c.r;
    p.data[1]=c.g;
    p.data[2]=c.b;
    p.data[3]=c.a;
    var data = ctx.getImageData(x, y, 1,1).data;
    ctx.putImageData(p,x,y);
}
var ipart = Math.floor;

function fpart(x) 
{
    return x - Math.floor(x);
}

function rfpart(x) 
{
    return 1.0 - fpart(x);
}

function Line(x0, y0, x1, y1, color) 
{
    if(color)  
	{ 
        Pixel.color = color;
    } 
	else 
	{
        Pixel.color = {r:0,g:0,b:0,a:255};
    }
    var steep = Math.abs(y1 - y0) > Math.abs(x1 - x0);
    if (steep)
	{
        x0 = y0 + (y0=x0, 0);
        x1 = y1 + (y1=x1, 0);
    }
    if (x0 > x1)
	{
        x0 = x1 + (x1=x0, 0); 
        y0 = y1 + (y1=y0, 0);
    }

    var dx = x1 - x0;
    var dy = y1 - y0;
    var gradient = dy / dx;

    var xend = Math.round(x0);
    var yend = y0 + gradient * (xend - x0);
    var xgap = rfpart(x0 + 0.5);
    var xpxl1 = xend;
    var ypxl1 = ipart(yend);

    if (steep) 
	{
        Pixel(ypxl1, xpxl1, rfpart(yend) * xgap);
        Pixel(ypxl1 + 1, xpxl1, fpart(yend) * xgap);
    } 
	else 
	{
        Pixel(xpxl1, ypxl1, rfpart(yend) * xgap);
        Pixel(xpxl1, ypxl1 + 1, fpart(yend) * xgap);
    }
    var intery = yend + gradient;

    xend = Math.round(x1);
    yend = y1 + gradient * (xend - x1);
    xgap = fpart(x1 + 0.5);
    var xpxl2 = xend;
    var ypxl2 = ipart(yend);

    if (steep) 
	{
        Pixel(ypxl2, xpxl2, rfpart(yend) * xgap);
        Pixel(ypxl2 + 1, xpxl2, fpart(yend) * xgap);
    } 
	else 
	{
        Pixel(xpxl2, ypxl2, rfpart(yend) * xgap);
        Pixel(xpxl2, ypxl2 + 1, fpart(yend) * xgap);
    }

    for (var x = xpxl1 + 1; x <= xpxl2 - 1; x++) 
	{
        if (steep) 
		{
            Pixel(ipart(intery), x, rfpart(intery));
            Pixel(ipart(intery) + 1, x, fpart(intery));
        } 
		else 
		{
            Pixel(x, ipart(intery), rfpart(intery));
            Pixel(x, ipart(intery) + 1, fpart(intery));
        }
        intery = intery + gradient;
    }
}


function Circle(x,y, radius, color)
{
    if(color)  
	{
        Pixel.color = color;
    } 
	else 
	{
        Pixel.color = {r:0,g:0,b:0,a:255};
    }
    var x0 = 0, y0 = radius, gap = 0, delta = (2 - 2 * radius);
    while (y0 >= 0)
    {
        Pixel(x + x0, y - y0, 1);
        Pixel(x - x0, y - y0, 1);
        Pixel(x - x0, y + y0, 1);
        Pixel(x + x0, y + y0, 1);
        gap = 2 * (delta + y0) - 1;
        if (delta < 0 && gap <= 0)
        {
            x0++;
            delta += 2 * x0 + 1;
            continue;
        }
        if (delta > 0 && gap > 0)
        {
            y0--;
            delta -= 2 * y0 + 1;
            continue;
        }
        x0++;
        delta += 2 * (x0 - y0);
        y0--;
    }
}


function Fill(x, y, color)
{
    var startColor = ctx.getImageData(x, y, 1,1).data;
    Pixel.color = color;
    var q = [[x,y]];
    for(var i = 0; i!= q.length; i++)
	{
        var x = q[i][0], y = q[i][1];
        var data = ctx.getImageData(x, y, 1,1).data;
        if(x>=0 && y>=0 && x<canvas.width && y<canvas.height && data[0]==startColor[0] && data[1]==startColor[1] && data[2]==startColor[2] && data[3]==startColor[3])
		{
		
            Pixel(x, y, 1);
            var s = q.length;
            q[s] = [x+1, y];
            q[s+1] = [x-1, y];
            q[s+2] = [x, y+1];
            q[s+3] = [x, y-1];
        }
    }
}

function getBezierBasis(i, n, t) { 
    
    function f(n) {
        if(n <= 1){
            return 1;
        }else{
            return n * f(n - 1);
        }
    };

    
    return (f(n)/(f(i)*f(n - i)))* Math.pow(t, i)*Math.pow(1 - t, n - i);
}


function getBezierCurve(arr) {

    var step = 0.01;
    var res = new Array();

    for (var t = 0; t < 1 + step; t += step) {
        if (t > 1) {
            t = 1;
        }

        var ytmp=0;
        var xtmp=0;

        for (var i = 0; i < arr.length; i++) {
            var b = getBezierBasis(i, arr.length - 1, t);
            xtmp += arr[i].x * b; 
            ytmp += arr[i].y * b;
        }
        res.push({"x":xtmp,"y":ytmp});

    }

    return res;
}
function Bezier(cords) {
    var arrayCords = getBezierCurve(cords);
    for (i=0; i<arrayCords.length-1;i++)
    {
        Line(arrayCords[i].x,arrayCords[i].y,arrayCords[i+1].x,arrayCords[i+1].y, {r:0,g:0,b:0,a:255});
    }
}

function Ellips(startX, startY, aElem, bElem) {
    var a = +aElem;
    var b = +bElem;
    for (var t=0; t<=2*Math.PI; t+=0.01) {
        var x = a*Math.cos(t);
        var y = b*Math.sin(t);
        ctx.fillRect(x + startX, y + startY, 1, 1);
    }
}
